    value: The Committee is in receipt of the Commissions Request for Further Information
      dated 12/08/2006 regarding the October Monthly Report.  -  Schedule A supporting
      Line 15 discloses a payment from Jovian P4 LLC for enhanced online voter file
      access.  Determination of usual and normal charges for Enhanced Online Voter
      File Access for payments received on the Committees report was calculated by
      the total cost of developing and hosting our online voter file and dividing
      it by the number of records within the file as well as the presumed number of
      overall users.  The cost to the organization is then determined by the number
      of records requested and the length of time access will be granted.  i.e. Statewide
      or congressional charges are based on the number of records in the district
      or entire state as requested.  This same methodology is utilized for any and
      all entities that purchase the committees voter file.  -  All payroll and benefits
      reported on Schedule H4 were for employees who spent 25% or less of their time
      on FEA or activities in connection with a Federal Election. Please note that
      payroll and benefits for employees that spent more than 25% of their time on
      FEA were disclosed on Schedule B supporting Line 30B.  -  The refund of over
